'{
  "$schema": "https://vega.github.io/schema/vega-lite/v5.json",
  "description": "Empty Return Container Count by Warehouse and Status with Overlapping Bars",
  "title": "Empty Return Container Count",
  "data": {
    "name": "dataset"
  },
  "transform": [
    {
      "calculate": "datum[''Count'']/2",
      "as": "center_position"
    }
  ],
  "layer": [
    {
      "transform": [
        {"filter": "datum[''Status''] == ''To Empty Return''"}
      ],
      "mark": {"type": "bar", "opacity": 1},
      "encoding": {
        "y": {
          "field": "Warehouse",
          "type": "ordinal",
          "sort": [
            "3-WAYS",
            "IRIS",
            "MARNIX",
            "WILMARSDONK",
            "TOTAL"
          ],
          "axis": {"title": null}
        },
        "x": {
          "field": "Count",
          "type": "quantitative",
          "title": ""
        },
        "color": {
          "datum": "To Empty Return",
          "scale": {
            "domain": ["Ready For Empty Return", "To Empty Return"],
            "range": ["#ACC957", "#4E9142"]
          },
          "legend": {
            "title": "",
            "orient": "bottom"
          }
        },
        "tooltip": [
          {"field": "Warehouse"},
          {"field": "Status"},
          {"field": "Count", "type": "quantitative"}
        ]
      }
    },
    {
      "transform": [
        {"filter": "datum[''Status''] == ''Ready For Empty Return''"}
      ],
      "mark": {"type": "bar", "opacity": 1, "size": 15},
      "encoding": {
        "y": {
          "field": "Warehouse",
          "type": "ordinal",
          "sort": [
            "3-WAYS",
            "IRIS",
            "MARNIX",
            "WILMARSDONK",
            "TOTAL"
          ]
        },
        "x": {
          "field": "Count",
          "type": "quantitative"
        },
        "color": {
          "datum": "Ready For Empty Return",
          "scale": {
            "domain": ["Ready For Empty Return", "To Empty Return"],
            "range": ["#ACC957", "#4E9142"]
          }
        },
        "tooltip": [
          {"field": "Warehouse"},
          {"field": "Status"},
          {"field": "Count", "type": "quantitative"}
        ]
      }
    },
    {
      "transform": [
        {"filter": "datum[''Status''] == ''To Empty Return''"}
      ],
      "mark": {
        "type": "text",
        "align": "right",
        "baseline": "middle",
        "color": "white",
        "dx": -3
      },
      "encoding": {
        "y": {
          "field": "Warehouse",
          "type": "ordinal",
                    "sort": [
            "3-WAYS",
            "IRIS",
            "MARNIX",
            "WILMARSDONK",
            "TOTAL"
          ]
        },
        "x": {
          "field": "Count",
          "type": "quantitative"
        },
        "text": {
          "condition": {
            "test": "datum[''Count''] >= 20",
            "field": "Count",
            "type": "quantitative"
          },
          "value": ""
        }
      }
    },
    {
      "transform": [
        {"filter": "datum[''Status''] == ''Ready For Empty Return''"}
      ],
      "mark": {
        "type": "text",
        "align": "center",
        "baseline": "middle",
        "color": "black",
        "dx": 0
      },
      "encoding": {
        "y": {
          "field": "Warehouse",
          "type": "ordinal",
                    "sort": [
            "3-WAYS",
            "IRIS",
            "MARNIX",
            "WILMARSDONK",
            "TOTAL"
          ]
        },
        "x": {
          "field": "center_position",
          "type": "quantitative"
        },
        "text": {
          "condition": {
            "test": "datum[''Count''] >= 20",
            "field": "Count",
            "type": "quantitative"
          },
          "value": ""
        }
      }
    },
    {
      "data": {
        "name": "dataset"
      },
      "transform": [
        {
          "aggregate": [
            {"op": "sum", "field": "Count", "as": "Count"}
          ],
          "groupby": ["Status"]
        },
        {
          "calculate": "''TOTAL''", 
          "as": "Warehouse"
        },
        {
          "calculate": "datum[''Count'']/2",
          "as": "center_position"
        }
      ],
      "layer": [
        {
          "transform": [
            {"filter": "datum[''Status''] == ''To Empty Return''"}
          ],
          "mark": {"type": "bar", "stroke": "white", "strokeWidth": 0},
          "encoding": {
            "y": {
              "field": "Warehouse",
              "type": "ordinal",
                        "sort": [
            "3-WAYS",
            "IRIS",
            "MARNIX",
            "WILMARSDONK",
            "TOTAL"
          ]
            },
            "x": {
              "field": "Count",
              "type": "quantitative"
            },
            "color": {
              "datum": "To Empty Return",
              "scale": {
                "domain": ["Ready For Empty Return", "To Empty Return"],
                "range": ["#ACC957", "#4E9142"]
              }
            },
            "tooltip": [
              {"field": "Warehouse"},
              {"field": "Status"},
              {"field": "Count", "type": "quantitative"}
            ]
          }
        },
        {
          "transform": [
            {"filter": "datum[''Status''] == ''Ready For Empty Return''"}
          ],
          "mark": {"type": "bar", "stroke": "white", "strokeWidth": 0, "opacity": 1, "size": 15},
          "encoding": {
            "y": {
              "field": "Warehouse",
              "type": "ordinal",
                        "sort": [
            "3-WAYS",
            "IRIS",
            "MARNIX",
            "WILMARSDONK",
            "TOTAL"
          ]
            },
            "x": {
              "field": "Count",
              "type": "quantitative"
            },
            "color": {
              "datum": "Ready For Empty Return",
              "scale": {
                "domain": ["Ready For Empty Return", "To Empty Return"],
                "range": ["#ACC957", "#4E9142"]
              }
            },
            "tooltip": [
              {"field": "Warehouse"},
              {"field": "Status"},
              {"field": "Count", "type": "quantitative"}
            ]
          }
        },
        {
          "transform": [
            {"filter": "datum[''Status''] == ''To Empty Return''"}
          ],
          "mark": {
            "type": "text",
            "align": "right",
            "baseline": "middle",
            "color": "white",
            "dx": -3
          },
          "encoding": {
            "y": {
              "field": "Warehouse",
              "type": "ordinal",
                        "sort": [
            "3-WAYS",
            "IRIS",
            "MARNIX",
            "WILMARSDONK",
            "TOTAL"
          ]
            },
            "x": {
              "field": "Count",
              "type": "quantitative"
            },
            "text": {
              "condition": {
                "test": "datum[''Count''] >= 20",
                "field": "Count",
                "type": "quantitative"
              },
              "value": ""
            }
          }
        },
        {
          "transform": [
            {"filter": "datum[''Status''] == ''Ready For Empty Return''"}
          ],
          "mark": {
            "type": "text",
            "align": "center",
            "baseline": "middle",
            "color": "black"
          },
          "encoding": {
            "y": {
              "field": "Warehouse",
              "type": "ordinal",
                        "sort": [
            "3-WAYS",
            "IRIS",
            "MARNIX",
            "WILMARSDONK",
            "TOTAL"
          ]
            },
            "x": {
              "field": "center_position",
              "type": "quantitative"
            },
            "text": {
              "field": "Count",
              "type": "quantitative"
            }
          }
        }
      ]
    }
  ]
}'
